import React from "react";
import style from "./global.module.css";

function Title(props) {
  return (
    <div
      style={{
        position: "relative",
        display: "flex",
        alignItems: "center",
        gridColumnStart: "2"
      }}
    >
      <div
        style={{
          width: "4px",
          height: "28px",
          backgroundColor: "#c7493a"
        }}
      ></div>
      <label className="component-label">{props.titleName}</label>
      {props.more === true && (
        <span className={style["view-all"]} onClick={props.onClickViewAll}>
          View All
        </span>
      )}
    </div>
  );
}

export default Title;
